import React, { Component } from "react";
import { Switch, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import Footer from "./components/About/Footer";
import AuthService from "./services/auth.service";
import Team from "./components/About/Team";
import Blog from "./components/About/Blog";
import Login from "./components/login.component";
import Register from "./components/register.component";
import Home from "./components/About/Home";
import Profile from "./components/profile.component";
import BoardUser from "./components/board-user.component";
import BoardAdmin from "./components/board-admin.component";
import companyLogo from "./images/logo.gif";
import Certificate from "./components/About/Certificate";
//import AuthVerify from "./common/auth-verify";
import EventBus from "./common/EventBus";
import Process from "./components/About/Process";

class App extends Component {
  constructor(props) {
    super(props);
    this.logOut = this.logOut.bind(this);

    this.state = {
      showModeratorBoard: false,
      showAdminBoard: false,
      currentUser: undefined,
    };
  }

  componentDidMount() {
    const user = AuthService.getCurrentUser();

    if (user) {
      this.setState({
        currentUser: user,
        showModeratorBoard: user.roles.includes("ROLE_MODERATOR"),
        showAdminBoard: user.roles.includes("ROLE_ADMIN"),
      });
    }

    EventBus.on("logout", () => {
      this.logOut();
    });
  }

  componentWillUnmount() {
    EventBus.remove("logout");
  }

  logOut() {
    AuthService.logout();
    this.setState({
      showModeratorBoard: false,
      showAdminBoard: false,
      currentUser: undefined,
    });
  }

  render() {
    const { currentUser, showAdminBoard } = this.state;

    return (
      <>
        <div>
          <nav class="navbar navbar-expand-lg navbar-light bg-light">
            <img src={companyLogo} alt="logo" height={100} />
            <Link to={"/"} class="navbar-brand" >
              <h3>E-Waste Collection</h3>
            </Link>
            <div>
              <li>
                <button type="button">
                  <Link to={"/home"}>HOME</Link>
                </button>
              </li>
            </div>
            {currentUser ? (
              <div>
                <li>
                  <button type="button">
                    <Link to={"/profile"}>{currentUser.username}</Link>
                  </button>
                </li>
                {showAdminBoard && (
                  <li>
                    <button type="button">
                      <Link to={"/admin"}>ADMIN BOARD</Link>
                    </button>
                  </li>
                )}
                {currentUser && (
                  <li>
                    <button type="button">
                      <Link to={"/user"}>DASHBOARD</Link>
                    </button>
                  </li>
                )}
                <li>
                  <button type="button">
                    <Link to={"/certificate"}>CERTIFICATE</Link>
                  </button>
                </li>
                <li>
                  <button type="button">
                    <Link to={"/login"} onClick={this.logOut}>
                      LOGOUT
                    </Link>
                  </button>
                </li>
              </div>
            ) : (
              <div>
                <li>
                  <button type="button">
                    <Link to={"/login"}>LOGIN</Link>
                  </button>
                </li>
                <li>
                  <button type="button">
                    <Link to={"/register"}>SIGN UP</Link>
                  </button>
                </li>
                <li>
                  <button type="button">
                    <Link to={"/team"}>MEET TEAM</Link>
                  </button>
                </li>
              </div>
            )}
          </nav>
          <div>
            <Switch>
              <Route exact path={["/", "/home"]} component={Home} />
              <Route exact path="/login" component={Login} />
              <Route exact path="/register" component={Register} />
              <Route exact path="/profile" component={Profile} />
              <Route path="/user" component={BoardUser} />
              <Route path="/admin" component={BoardAdmin} />
              <Route path="/team" component={Team} />
              <Route exact path="/certificate" component={Certificate} />
              <Route path="/blog" component={Blog} />
              <Route path="/process" component={Process} />
            </Switch>
          </div>
          {/*<AuthVerify logOut={this.logOut}/> */}
        </div>
        <footer>
          <Footer />
        </footer>
      </>
    );
  }
}

export default App;
